import React from "react";
import { Link } from "react-router-dom";

const User = ({ posts }) => {
  const userData = posts.map((user, key) => (
    <div>
      <Link
        key={key}
        className="dropdown-item"
        to={{ pathname: `/update-user/${user._id}` }}
      >
        <div className="text-center "> User </div>
      </Link>
    </div>
  ));
};

function UserData() {
  return <div>{User}</div>;
}

export default UserData;
